import logo from './logo.svg';
import './App.css';

let counter = 0;

function show() {
  counter++;
  const el = <p>{counter}</p>;
  ReactDOM.render(
    el,
document.getElementById("container")
  );
}

setInterval(show, 1000);
export default App;
